import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";

// For the bits that make scrolling work as expected.
import { ScrollContext } from 'react-router-scroll-4';

// The pages components by the router
import Home       from './components/home'
import Details    from './components/details'
import HeaderBar  from './components/header-bar'

import leafIcon from './rescources/plain-leaf.svg';


class App extends Component {
    render() {
        return (
            <Router path={process.env.PUBLIC_URL + '/'}>
                <ScrollContext>
                    <div className="App">
                        <HeaderBar />

                        <Route path="/" exact component={Home} />
                        <Route path="/details/:license/:prettyname" component={Details} />

                        <Link to={'#'}>Just a link to shut the compiler up.</Link>

                        <svg style="display:none;">
                            <symbol id="plain-leaf" viewBox="0 0 64 64">
                                <path id="leaf" class="sprite-svg" d="M32,2c0,0,7.2,10,7.2,21.6s-7.1,20.8-7.1,20.8s-7.4-9.2-7.4-20.8S32,2,32,2z M4.5,21.1c0,0,3,9,10.2,15.4s15.9,8,15.9,8s-2.4-8.7-9.6-15.1S4.5,21.1,4.5,21.1z M59.7,21.1c0,0-3,9-10.2,15.4s-15.9,8-15.9,8s2.4-8.7,9.6-15.1S59.7,21.1,59.7,21.1z M59,44.5c0,0-5.7,3.9-12.6,4.2s-12.5-2.9-12.5-2.9s5.2-3.9,12.1-4.3C53,41.1,59,44.5,59,44.5z M5.3,44.5c0,0,5.7,3.9,12.6,4.2s12.5-2.9,12.5-2.9s-5.2-3.9-12.1-4.3C11.4,41.1,5.3,44.5,5.3,44.5z M45.8,56.1c0,0-4.4-0.6-7.8-3.3s-4.7-6.6-4.7-6.6s4.1,0.3,7.6,3.1C44.3,52,45.8,56.1,45.8,56.1z M18.5,56.7c0,0,4.4-0.6,7.8-3.3s4.7-6.6,4.7-6.6s-4.1,0.3-7.6,3.1C19.9,52.6,18.5,56.7,18.5,56.7z M33.1,45.1h-1.8c0,0,0.5,11.4,5,17.7c0.5,0.2,1.9-0.4,2.9-0.4s1.4-0.9,1.4-0.9S34.4,56.6,33.1,45.1z"/>
                            </symbol>
                        </svg>

                        {<object type={"image/svg+xml"} id={'svg-spritesheet'} data={leafIcon}>SVG No Bueno!</object>}
                    </div>
                </ScrollContext>
            </Router>
        );
    }
}

export default App;
